// eslint-disable-next-line
import React from 'react';

const ToDoList = () => {
    const items = ['Learn React', 'Create awesome App']
    return (<ul>
        <li>{items[0]}  </li>
        <li>{items[1]}</li>
    </ul>)
}
export default ToDoList;
